import React, { Component } from 'react';

class Header extends Component {
  render() {
    return (
      <div className="header">
        <a href="">NetHosting</a>
        <a href="">Home</a>
        <a href="">Services</a>
        <a href="">Pricing</a>
        <a href="">Business</a>
        <a href="">SignUp!</a>
      </div>
    );
  }
}

export default Header;
